public IneqMesh GetIneqMesh()
{
  	var sdf = new SignedDistance("obj_2_ChickenH.stl");
	var f = sdf.From;
  	var b = new IneqTree(f) ;
  
    var res = new IneqMesh
    {
        X0 = -1,
        Y0 = -1,
        Z0 = -1,
        X1 = 1,
        Y1 = 1,
        Z1 = 1,
        D = 0.1,
        Boxed = false,
        IneqTree =
          b //| Ball(0,-0.5,-0.3,0.5)
	};
	
  	res.ProjectToSurfaceSpec[f] = sdf.Project;	
  	res.PrepareBackgroundMesh = () => res.RefineTetrahedralMeshByTetrahedrons(0, 1, 0.05, true);
  
	return res;  
}
